INSERT INTO `proposal` VALUES ('8', 'AOI自动缺陷辨识', 'AOI自动缺陷辨识,减少人力训练及复判成本\n', 'AOI仰赖人工缺陷辨识, 判断结果缺乏一致性, 且需花费高度人力训练及作业成本\n', '透过大深度学习的技术, 自动学习缺陷特征 , 自动筛选特征区, 以减少人力成本与生产浪费,  并能弹性化调整缺陷检测类别来实现快速换线\n', '125', null, null, 'a. 各缺陷类别收集足量的数据\nb. 复杂的样型需要更多训练样本，须包含「相似」与「不相似」的图片，以达到更高的辨识精确度', '2017-09-21 17:08:37', '2017-09-26 16:40:16', '22', '1');
